type Complexity struct {
	Cognitive	int
	Cyclomatic	int
	Lines		int

	// Coverage is filled out of band (summary coverfunc).
	Coverage	float64	`json:",omitempty"`
}

// Field holds details about a field definition.
type Field struct {
	// Name is the name of the field.
	Name	string

	// Type is the literal type of the Go field.
	Type	string	`json:",omitempty"`

	// Path is the go path of this field starting from root object.
	Path	string

	// Doc holds the field doc.
	Doc	string	`json:",omitempty"`

	// Comment holds the field comment text.
	Comment	string	`json:",omitempty"`

	// Tag is the go tag, unmodified.
	Tag	string	`json:",omitempty"`

	// JSONName is the corresponding json name of the field.
	// It's cleared if it's set to `-` (unexported).
	JSONName	string

	// MapKey is the map key type, if this field is a map.
	MapKey	string	`json:",omitempty"`
}

// Package holds go package information.
type Package struct {
	// ID is the ID of the package as x/tools packages loads it.
	ID	string
	// Package is the name of the package.
	Package	string
	// ImportPath contains the import path (github...).
	ImportPath	string
	// Path is sanitized to contain the relative location (folder).
	Path	string
	// TestPackage is true if this is a test package.
	TestPackage	bool

	// Complexity to collect test coverage on package.
	Complexity	*Complexity	`json:",omitempty"`

	// Pkg serves to carry ast package information, preventing a double Load().
	// It's used during analysis and merging and discarded for the result.
	Pkg	*packages.Package	`json:"-"`
}

