// Map over a DefinitionList
func Map[T any](defs DefinitionList, fn func(*Definition) T) []T {
	out := make([]T, 0, len(defs))
	for _, d := range defs {
		out = append(out, fn(d))
	}
	return out
}

func NewStringSet() StringSet {
