// Reduce over a DefinitionList
func Reduce[T any, R any](defs DefinitionList, acc R, fn func(R, *Definition) R) R {
	for _, d := range defs {
		acc = fn(acc, d)
	}
	return acc
}

// TypeRef aims to trim a type name to a reference type.
func TypeRef(name string) string {
	// trim variadic arg
	if strings.HasPrefix(name, "...") {
		name = name[3:]
	}

	// slice, array and map value
	// in terms of nesting, this is a hack
	if strings.HasPrefix(name, "[") || strings.HasPrefix(name, "map[") {
		name = strings.SplitN(name, "]", 2)[1]
	}

	// deref pointers
	return strings.TrimPrefix(name, "*")
}

func (d *Declaration) Equal(in *Declaration) bool {
	if d.File == in.File && d.Kind == in.Kind && d.Name == in.Name {
		return true
	}
	return false
}

func (d *Declaration) HasName(find string) bool {
	for _, name := range d.Names {
		if name == find {
			return true
		}
	}
	return d.Name == find
}

func (d *Declaration) IsExported() bool {
	if d.Receiver != "" && !ast.IsExported(TypeRef(d.Receiver)) {
		return false
	}

	for _, name := range d.Names {
		if ast.IsExported(name) {
			return true
		}
	}
	return ast.IsExported(d.Name)
}

func (d *Declaration) Keys() []string {
	trimPath := "*."
	if d.Name != "" {
		return []string{
			strings.Trim(d.Receiver+"."+d.Name, trimPath),
		}
	}
	if len(d.Names) != 0 {
		result := make([]string, len(d.Names))
		for k, v := range d.Names {
			result[k] = strings.Trim(d.Receiver+"."+v, trimPath)
		}
	}
	return nil
}

func (f *Declaration) ReceiverTypeRef() string {
	return TypeRef(f.Receiver)
}

func (f *Declaration) TypeRef() string {
	return TypeRef(f.Type)
}

func (p *DeclarationList) Append(in ...*Declaration) {
	*p = append(*p, in...)
}

func (p *DeclarationList) AppendUnique(in ...*Declaration) {
	for _, i := range in {
		shouldAppend := true
		for _, decl := range *p {
			if decl.Equal(i) {
				shouldAppend = false
				break
			}
		}

		if shouldAppend {
			*p = append(*p, i)
		}
	}
	p.Sort()
}

func (p *DeclarationList) ClearNonTestFiles() {
	result := DeclarationList{}
	for _, decl := range *p {
		if !strings.HasSuffix(decl.File, "_test.go") {
			continue
		}
		result.Append(decl)
	}
	*p = result
}

func (p *DeclarationList) ClearSource() {
	for _, decl := range *p {
		decl.Source = ""
	}
}

func (p *DeclarationList) ClearTestFiles() {
	result := DeclarationList{}
	for _, decl := range *p {
		if strings.HasSuffix(decl.File, "_test.go") {
			continue
		}
		result.Append(decl)
	}
	*p = result
}

func (p *DeclarationList) Sort() {
	sort.Slice(*p, func(i, j int) bool {
		a, b := (*p)[i], (*p)[j]
		if a.Kind != b.Kind {
			indexOf := map[DeclarationKind]int{
				CommentKind:	0,
				ImportKind:	1,
				ConstKind:	2,
				StructKind:	3,
				TypeKind:	4,
				VarKind:	5,
				FuncKind:	6,
			}
			return indexOf[a.Kind] < indexOf[b.Kind]
		}
		ae, be := ast.IsExported(a.Name), ast.IsExported(b.Name)
		if ae != be {
			return ae
		}

		if a.Receiver != b.Receiver {
			if a.Receiver == "" {
				return true
			}
			return a.Receiver < b.Receiver
		}

		if a.Signature != b.Signature {
			return a.Signature < b.Signature
		}

		return a.Name < b.Name
	})
}

func (d *Definition) ClearNonTestFiles() {
	for filename, _ := range d.Imports {
		if !strings.HasSuffix(filename, "_test.go") {
			delete(d.Imports, filename)
		}
	}
	d.Types.ClearNonTestFiles()
	d.Vars.ClearNonTestFiles()
	d.Consts.ClearNonTestFiles()
	d.Funcs.ClearNonTestFiles()
}

func (d *Definition) ClearSource() {
	d.Types.ClearSource()
	d.Vars.ClearSource()
	d.Consts.ClearSource()
	d.Funcs.ClearSource()
}

func (d *Definition) ClearTestFiles() {
	for filename, _ := range d.Imports {
		if strings.HasSuffix(filename, "_test.go") {
			delete(d.Imports, filename)
		}
	}
	d.Types.ClearTestFiles()
	d.Vars.ClearTestFiles()
	d.Consts.ClearTestFiles()
	d.Funcs.ClearTestFiles()
}

// DeclarationList merges all the declarations together.
func (d *Definition) DeclarationList() DeclarationList {
	allDecls := DeclarationList{}
	allDecls.Append(d.Consts...)
	allDecls.Append(d.Vars...)
	allDecls.Append(d.Types...)
	allDecls.Append(d.Funcs...)
	return allDecls
}

func (d *Definition) Fill() {
	for _, decl := range d.Order() {
		decl.Imports = d.getImports(decl)
	}
}

func (d *Definition) Merge(in *Definition) {
	d.TestPackage = d.TestPackage || in.TestPackage

	for k, v := range in.Imports {
		d.Imports.Add(k, v...)
	}

	d.Types.AppendUnique(in.Types...)
	d.Funcs.AppendUnique(in.Funcs...)
	d.Vars.AppendUnique(in.Vars...)
	d.Consts.AppendUnique(in.Consts...)

	// this line causes Sort to be omitted from the
	// definitions :/ ... solved by adding the sort
	// in the AppendUnique above, but the Sort symbol
	// should not be omitted from Definition.

	// d.Sort()
}

func (d *Definition) Order() DeclarationList {
	count := len(d.Types) + len(d.Funcs) + len(d.Vars) + len(d.Consts)
	result := make([]*Declaration, 0, count)

	result = append(result, d.Types...)
	result = append(result, d.Funcs...)
	result = append(result, d.Vars...)
	result = append(result, d.Consts...)
	return DeclarationList(result)
}

// Sort will sort the inner types so they have a stable order.
func (d *Definition) Sort() {
	d.Types.Sort()
	d.Vars.Sort()
	d.Consts.Sort()
	d.Funcs.Sort()
}

