func (i *StringSet) Add(key string, lits ...string) {
	data := *i
	if data == nil {
		data = make(StringSet)
	}
	if set, ok := data[key]; ok {
		for _, lit := range lits {
			if slices.Contains(set, lit) {
				return
			}
			set = append(set, lit)
		}

		data[key] = set
		return
	}
	data[key] = lits[:]
	*i = data
}

